import React from 'react';
import { ThemeProvider } from '@mui/material/styles';
import theme from './Theme';
import Formulario from './Formulario';

const App = () => {
  return (
    <ThemeProvider theme={theme}>
      <Formulario />
    </ThemeProvider>
  );
};

export default App;
